import Axios from "axios";

const host = "http://127.0.0.1:4567"

const get = async (link) => {
    return await Axios.get(`${host}${link}`)
}

const post = (link, data) => {
    let response =[];
    Axios.post(`${host}${link}`, data).then(res => response.push(res))
    return response
}

export {get, post};
